import { View } from "./view";

class AddRecipeView extends View {
  _openWindow = document.querySelector(".nav__btn--add-recipe");
  _parentElement = document.querySelector(".upload");
  _window = document.querySelector(".add-recipe-window");
  _closeWindow = document.querySelector(".btn--close-modal");
  _overlay = document.querySelector(".overlay");

  constructor() {
    super();
    this._openWindow.addEventListener("click", this._toggleWindow.bind(this));
    this._closeWindow.addEventListener("click", this._toggleWindow.bind(this));
    this._overlay.addEventListener("click", this._toggleWindow.bind(this));
  }
  _toggleWindow() {
    this._window.classList.toggle("hidden");
    this._overlay.classList.toggle("hidden");
  }
  handlerForm(heandler) {
    this._parentElement.addEventListener("submit", function (e) {
      e.preventDefault();
      const dataObj = new FormData(this);
      const dataArr = Object.fromEntries(dataObj);
      heandler(dataArr);
    });
  }
}

export default new AddRecipeView();
